import React from 'react';
import {
    NavBarContainer,
    NavigationContainer,
    NavigationButton
} from './navBar.styled'

const NavBar = () => {
    return (
        <NavBarContainer>
            <NavigationContainer>
                <NavigationButton>About</NavigationButton>
                <NavigationButton>Education</NavigationButton>
                <NavigationButton>Experience</NavigationButton>
                <NavigationButton>Publication</NavigationButton>
                <NavigationButton></NavigationButton>
            </NavigationContainer>
        </NavBarContainer>
    )
}

export default NavBar;
